import React from 'react';

const WordListTable = () => {
  // Dados mockados para a tabela
  const words = [
    { palavra: 'Sanduíche', peso: 3 },
    { palavra: 'Sanduíche', peso: 6 },
    { palavra: 'Sanduíche', peso: 12 },
    { palavra: 'Sanduíche', peso: 25 },
    { palavra: 'Sanduíche', peso: 34 },
  ];

  return (
    <div className="border border-gray-300 rounded-md overflow-hidden">
      <table className="min-w-full text-left">
        <thead className="bg-gray-200">
          <tr>
            <th className="p-2">Palavra</th>
            <th className="p-2">Peso</th>
          </tr>
        </thead>
        <tbody>
          {words.map((word, index) => (
            <tr key={index} className="even:bg-gray-100">
              <td className="p-2">{word.palavra}</td>
              <td className="p-2">{word.peso}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default WordListTable;
